import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import SideNavbar from "../../components/Doctor/sidenavbar";
import Navbar from "../../components/Doctor/Navbar";
import '../../css/Doctor/ddashboard.css';
import DoctorDashboard from './Ddashboard';
import PreviousAppointments from './Appointment';

export default function Dashboard() {
  const [showBookedAppointments, setShowBookedAppointments] = useState(false);
  const [showPreviousAppointments, setShowPreviousAppointments] = useState(false);

  const handleBookedAppointmentsClick = () => {
    setShowBookedAppointments(true);
    setShowPreviousAppointments(false);
  };

  const handlePreviousAppointmentsClick = () => {
    setShowBookedAppointments(false);
    setShowPreviousAppointments(true);
  };

  return (
    <div className="dashboard-container">
      <Navbar />
      <div className='dashboard-content'>
        <SideNavbar />
        <div className='main-content'>
          <div className="appointments-buttons">
            <button onClick={handleBookedAppointmentsClick}>Booked Appointments</button>
            <button onClick={handlePreviousAppointmentsClick}>Previous Appointments</button>
          </div>
          {showBookedAppointments && <DoctorDashboard />}
          {showPreviousAppointments && <PreviousAppointments />}
        </div>
      </div>
    </div>
  );
}
